Пускатель ПНВС (пусковая кнопка ПН ВС) применяется для остановки и пуска однофазных короткозамкнутых электродвигателей. При этом двигатель должен соответствовать следующим характеристикам:

Максимальная мощность: 1,5 кВт;
Максимальное напряжение: 380В;
Максимальный ток: 10А;
Вид тока: переменный;
Частота тока 50Гц.

Пускатель ПНВС конструктивно состоит из двух кнопок Пуск и Стоп. При нажатии на кнопку Пуск и удержании ее, замыкаются все три пары контактов: две пары подают питание на мотор и одна на пусковой конденсатор. При отпускании, центральный контакт размыкается и пусковой конденсатор отключается, а два крайних механически фиксируются и остаются замкнутыми, питая мотор. При этом пусковой конденсатор отключается от сети, а если применяется еще и рабочий конденсатор, то он остается подключенным. При нажатии на кнопку Стоп, все три группы контактов возвращаются в разомкнутое состояние.
Размеры 97х74х68 мм. 

Подходит для: бетономешалок, сверлильных станков, наждачных станков, крупорушек, прессов, токарных станков и другого оборудования с асинхронными двигателями.

Средний контакт размыкается . Требуется при запуске асинхронных двигателей. Можно использовать, когда трехфазный двигатель 380 вольт подсоединяют к однофазной сети 220 в . Конденсатор пусковой подсоединяют к среднему контакту для кратковременного включения. Используют пусковые 450 в и пуско-рабочие 330 в конденсаторы. Медные контакты позволяют работать ПНВС долгие годы без замены . Схема на последнем фото.

Отбойный молоток – переносной ручной инструмент с электродвигателем рассчитан при применение в строительно-монтажных работах. Устройство служит для демонтажа конструкций из камня, кирпича, бетона и различных твердых материалов. С отбойным молтком возможно выбивание частей асфальтобетонных поверхностей и заледеневших грунтов. Инструмент широко применяется в ремонте для сбивания облицовки из плитки и керамогранита. 
Преимущества: 
Увеличенная сила удара при пониженной частоте возвратно-поступательных движений позволяет успешно работать с особо прочными материалами; 
Наличие дополнительной рукоятки способствует удобному удержанию инструмента; 
Установка оснастки не требует применения специальных ключей; 
Система гашения вибраций снижает нагрузку на руки; 
Для предотвращения перегрева предусмотрено самопроизвольное отключение щеток.
